-   DataFrames.jl has some data wrangling functions like `transform`, `filter`, `combine` etc.

::: {#ec4df80a .cell execution_count=4}
``` {.julia .cell-code}
df2 = transform(df, :age => (x -> 2x) => :age_doubled)
```

